description:
La base ARES (pour agrégats régionaux sur les établissements de santé) constitue un ensemble d’indicateurs régionaux dont l’analyse est robuste en niveau comme en évolution. Elle se compose de 21 agrégats répartis en 3 fichiers :  
• Nombre d’établissements de santé en France _(3 agrégats)_ ;  
• Capacités et activité en MCO en France _(8 agrégats)_ ;  
• Capacités, activité et équipements hors MCO en France _(10 agrégats)_.
Ces données sont produites à partir des bases statistiques de la [Statistique annuelle des établissements (SAE)](https://drees.solidarites-sante.gouv.fr/sources-outils-et-enquetes/00-la-statistique-annuelle-des-etablissements-sae) de santé et sont mises à jour chaque année.
Un DREES Méthodes documente de façon approfondie la méthodologie et les révisions apportées. Vous le trouverez en pièce jointe de ce jeu de données ou à l'adresse suivante : <https://drees.solidarites-sante.gouv.fr/publications/drees-methodes/la-base-ares-agregats-regionaux-sur-les-etablissements-de-sante>

Le registre vise à recenser les copropriétés à usage d’habitat. Il permet de procéder en ligne à l’immatriculation et à la mise à jour des données d’une copropriété par son représentant légal ou par un notaire, et d’accéder à un annuaire et à des données statistiques. Les données collectées contribuent aux politiques publiques à destination des copropriétés. 
En vertu de l'article L711-2 du code de la construction et de l"habitation, les données du registre doivent être publiées notamment:
- Le nom, l'adresse, la date de création du syndicat, le nombre et la nature des lots qui composent la copropriété ainsi que, le cas échéant, le nom du syndic ;
- si le syndicat fait l'objet d'une procédure prévue aux articles 29-1 A ou 29-1 de la loi n° 65-557 du 10 juillet 1965 fixant le statut de la copropriété des immeubles bâtis ou à l'article L. 615-6 du présent code ;
- si le syndicat fait l'objet d'un arrêté pris en application du chapitre Ier du titre Ier du livre V du présent code.

La table réunit l’ensemble des données utilisées pour la construction de la dimension économique de l’index du développement durable breton. Cette dimension regroupe des thèmes et des indicateurs portant sur les dynamiques économique des territoires bretons à l’échelle des établissements publics de coopération intercommunale (EPCI). Pour chaque sous-dimension, la donnée fournit :
- les indicateurs statistiques ;
- les mêmes indicateurs statistiques normalisés et ordonnancés sur 1 ;
- un indice synthétique qui correspond à la moyenne des indicateurs statistiques normalisés ;
- une catégorie de territoire (territoire équilibré A, territoire intermédiaire B, territoire fragile C) calculé en fonction du positionnement de l’indice par rapport au 58 autres indices (un par EPCI).
Pour plus d’informations sur la structuration de la table et les sources de données, se reporter au dictionnaire des données, téléchargeable à l’adresse suivante : http://kartenn.region-bretagne.fr/portail-idd/data.html

La table réunit l’ensemble des données utilisées pour la construction de la dimension sociale de l’index du développement durable breton. Cette dimension regroupe des thèmes et des indicateurs en lien avec les questions de cohésion sociale, de bien-être et d’épanouissement des individus à l’échelle des établissements publics de coopération intercommunale (EPCI).
Pour chaque sous-dimension, la donnée fournit :
- les indicateurs statistiques ;
- les mêmes indicateurs statistiques normalisés et ordonnancés sur 1 ;
- un indice synthétique qui correspond à la moyenne des indicateurs statistiques normalisés ;
- une catégorie de territoire (territoire équilibré A, territoire intermédiaire B, territoire fragile C) calculé en fonction du positionnement de l’indice par rapport au 58 autres indices (un par EPCI).
Pour plus d’informations sur la structuration de la table et les sources de données, se reporter au dictionnaire des données, téléchargeable à l’adresse suivante : http://kartenn.region-bretagne.fr/portail-idd/data.html

Fichiers contenant les montants des primes de l'éducation nationale en fonction du temps.
Primes et indemnités disponibles :
- ISOE (indemnité de suivi et d'orientation des élèves), cette prime est indexée sur la valeur du point d'indice majoré de la fonction publique ;
- ISAE (indemnité de suivi et d'accompagnement des élèves), cette prime n'est pas indexée sur la valeur du point d'indice majoré de la fonction publique ;
- prime d'attractivité (aussi connue sous le nom de prime Blanquer, ou prime Grenelle) ;
- prime équipement informatique (montant versé annuellement sur la paye de février).

Les grilles indiciaires donnent le nombre de points d'indice bruts pour chaque échelon en fonction du temps et sont nommées sous la forme **certifies_[grade]_indices_bruts.csv**, où **[grade]** est égal à **cn** (classe normale), à **hc** (hors classe) ou à **ce** (classe exceptionnelle).
Colonnes des grilles indiciaires :
- date_effet : date (format AAAA-MM-JJ) d’entrée en vigueur de la valeur d'indice brut indiquée ;
- date_texte : date (format AAAA-MM-JJ) de la signature de l’arrêté ou du décret ;
- date_parution_jo : date (format AAAA-MM-JJ) de parution au journal officiel ;
- echelon_n (avec n un entier positif) : numéro d'échelon dans le grade ;
- lien_legifrance : lien vers l’arrêté ou le décret.
Les grilles d'avancement d'échelon donnent les durées de chaque échelon et les conditions de passage au grade supérieur. Elles sont nommées sous la forme **certifies_[grade]_durees_[AAAA-MM-JJ].csv**, où **[AAAA-MM-DD]** est la date d'entrée en vigueur de la nouvelle grille.
Colonnes des grilles d'avancement d'échelon :
- echelon : numéro de l'échelon dans le grade ;
- duree_anciennete : durée de l'échelon avec avancement à l'ancienneté ;
- duree_choix : durée de l'échelon avec avancement au choix (ou bien accélération de carrière à partir du 1er septembre 2017) ;
- duree_grand_choix : durée de l'échelon avec avancement au grand choix ;
- echelon_promo_[grade] : numéro d'échelon lors de la promotion au grade supérieur ("ind" si classement à l'échelon comportant un indice égal ou immédiatement supérieur) ;
- anciennete_echelon_promo_[grade] : ancienneté à atteindre dans l'échelon avant la promotion au grade supérieur ;
- anciennete_promo_[grade] : devenir de l'ancienneté dans l'échelon après promotion dans le grade supérieur ("acq" si l'ancienneté acquise est conservée, sans sinon) ;
- limite anciennete_promo_[grade] : limite fixée à l'ancienneté conservée après promotion dans le grade supérieur ou bien "traitement" : ancienneté perdue si l'augmentation de traitement consécutive à la promotion est supérieure à celle qu'aurait procurée un avancement d’échelon dans l'ancien grade, "promo" : limitation au temps nécessaire à la promotion d'échelon dans le grade supérieur ;
- majoration_anciennete_promo_[grade] : nombre d'années ajoutée à l'ancienneté dans l'échelon au moment de la promotion (ce nombre peut être négatif) ;
Les grilles de reclassement, donnant les règles de reclassement correspondant à l'entrée en vigueur d'une nouvelle grille d'avancement, sont nommées sous la forme **certifies_[grade]_reclassement_[AAAA-MM-JJ].csv**.
Colonnes des grilles de reclassement :
- echelon_depart : échelon avant reclassement ;
- anciennete_depart : nombre d'années d'ancienneté à avoir dans l'échelon avant reclassement ;
- classe_arrivee : présent uniquement si le grade est différent après reclassement ("cn", "hc" ou "ce") ;
- echelon_arrivee : échelon après reclassement (numéro de l'échelon ou "anc_corps" si l'échelon est calculé en fonction de l'ancienneté dans le corps) ;
- anciennete_arrivee : devenir de l'ancienneté après reclassement ("acq" si l'ancienneté acquise est conservée, "sans" sinon) ;
- majoration_anciennete_arrivee : nombre d'années ajoutée à l'ancienneté dans l'échelon après reclassement (ce nombre peut être négatif) ;
- remuneration_securisee : vaut "oui" si l'ancien traitement est maintenu en cas de traitement inférieur après reclassement ;
- limite_anciennete_arrivee : valeur maximale de l'ancienneté après reclassement.

Taux de l'indemnité de résidence de la fonction publique en fonction du temps.
Colonnes du fichier :
- date_effet : date (format AAAA-MM-JJ) d’entrée en vigueur de la valeur indiquée ;
- date_texte : date (format AAAA-MM-JJ) de la signature de l’arrêté ou du décret ;
- date_parution_jo : date (format AAAA-MM-JJ) de parution au journal officiel ;
- ir_zone_n (avec n entre 1 et 6) : pourcentage de l'indemnité de résidence ;
- lien_legifrance : lien vers l’arrêté ou le décret.

Le service des voyages officiels, placé sous l'autorité de la direction générale de la Police nationale, s'occupe des mesures de sécurité autour du Président de la République et des hautes personnalités françaises, ainsi que de l'organisation des déplacements officiels. Les dossiers d'archives produits dans le cadre de ces missions sont conservés aux Archives nationales. Les différents inventaires détaillés ont permis d'établir une liste chronologique structurée et détaillée des déplacements des présidents de la République et des premiers ministres depuis 1945.   
Cette liste de plus de 2750 déplacements en France et à l'étranger ne prétend pas à l'exhaustivité, mais plutôt offrir un panorama géographique et chronologique assez riche. Sont ainsi accessibles :  
  * pour le Président de la République : 1352 déplacements, 128 pays, pour la période 1945-2018 ;  
  * pour le Premier ministre : 1398 déplacements, 79 pays, pour la période 1964-2018.  
Le jeu de données mis à disposition est constitué des informations suivantes :
  * Fonction : Président de la République ou Premier ministre ;  
  * Individu ;  
  * Lieu : d'après le contenu de l'inventaire initial ;  
  * Lieu normalisé : département ou région pour la France ;  
  * Pays ;  
  * Date de début ; 
  * Date de fin ;  
  * URL(s) de la notice ;  
  * Cote(s) ;  
  * Contenu initial de l'inventaire : ce champ peut permettre d'avoir des compléments d'informations sur le type de déplacement, les différentes étapes d'un voyage (notamment à l'étranger), voire la mention de photographies.  
Un accès cartographique est proposé ici, basé sur les contours de la colonne _lieu normalisé_ (sources principales utilisées : [opendatasoft](https://public.opendatasoft.com/) et [angelodlfrtr](https://gist.github.com/angelodlfrtr/cf39d7db97c335f87d22)).
Les dossiers d'archives du service des voyages officiels consultables aux Archives nationales sont généralement constitués des pièces suivantes : programme détaillé du déplacement (parfois brochure imprimée), ordre des voitures officielles, plan de tables, notes et correspondance relatives à la sécurité, coupures de presse. Ces données sont à compléter avec les archives des services photographiques de la Présidence de la République et du Premier ministre, en partie numérisées :
  * [reportages photographiques des chefs de l'État et des présidents de la République (1938-1959)](https://www.siv.archives-nationales.culture.gouv.fr/siv/IR/FRAN_IR_050658) ;  
  * [reportages photographiques de la présidence de Charles de Gaulle](https://www.siv.archives-nationales.culture.gouv.fr/siv/IR/FRAN_IR_054722) ;  
  * [reportages photographiques de la présidence de Georges Pompidou](https://www.siv.archives-nationales.culture.gouv.fr/siv/IR/FRAN_IR_055457) ;  
  * [service photographique du Premier ministre](https://www.siv.archives-nationales.culture.gouv.fr/siv/NP/FRAN_NP_000141).  
Les données seront mises à jour lors des versements d'archives ultérieurs du service des voyages officiels.
Mise à jour du 20/04/2023 : ajout de 102 entrées (principalement des voyages à l'étranger) pour les années 2006 à 2008 (versement d'archives 20220621)
Mise à jour du 02/07/2025 : ajout de 243 entrées (essentiellement des voyages en outre-mer et à l'étranger) pour les années 2008 à 2018 (versement d'archivs 20250096)

Trois enquêtes sur les moulins à farine sont diligentées par l'Etat entre l'an II (1794) et 1809. L'enquête de l'an X (1801) concerne plus spécifiquement l'approvisionnement de Paris. Les réponses comportent, en plus des informations économiques et statistiques attendues, la liste des meuniers. Cette enquête ne concerne que 8 départements (Aisne, Eure, Eure-et-Loir, Loiret, Marne, Oise, Seine, Seine-et-Marne et Seine-et-Oise), représentant tout de même 5157 moulins.  
Le jeu de données mis à disposition est issu d'un index nominatif élaboré dans les années 1990 par M. Illaire ([consultable en ligne](https://www.siv.archives-nationales.culture.gouv.fr/siv/IR/FRAN_IR_058838)). Sont répertoriées, pour chaque moulin, les informations suivantes : 
  * nom du meunier ;
  * prénom du meunier (le cas échéant) ;  
  * commune d'exercice ;
  * département ;  
  * type de moulin (à eau ou à vent) ;  
  * nom du moulin ;
  * observations éventuelles ;
  * URL de la notice sur le portail des Archives nationales ;
  * cote.
Un meunier pouvant être propriétaire de plusieurs moulins, un individu peut avoir plusieurs entrées.

Trois enquêtes statistiques sur les moulins à farine sont diligentées par l’État en l'an II (1794), l'an X (1801) et 1809. Il s'agit pour le gouvernement d'évaluer les moyens de production de farines, d'un point de vue quantitatif (volume produit), qualitatif (qualité des farines, réseaux routiers à proximité) mais aussi prospectif (état matériel des moulins, variation saisonnière). Les enquêtes de 1794 et 1809 sont d'envergure nationales ; celle de 1801 concerne les 8 départements qui approvisionnent Paris.
  * l'enquête de 1794 recense plus de 6800 moulins répartis sur 72 départements ;
  * celle de 1801, environ 4460 moulins pour 8 départements (approvisionnement de Paris) ;
  * celle de 1809, près de 9000 moulins pour 115 départements (dont les départements de l'Empire situés aujourd'hui en Belgique, Pays-Bas, Suisse et Italie).
Ces données statistiques par département ne sont pas exhaustives : des sous-préfectures n'ont pas répondu aux enquêtes et certains arrondissements sont lacunaires, ou leurs données non exhaustives. Treize départements ne figurent dans aucune des trois enquêtes (Ardèche, Cher, Corse, Haute-Garonne, Loire, Haute-Loire, Marne, Mayenne, Rhône, Sarthe, Savoie, Haute-Savoie, Deux-Sèvres).
Néanmoins ce jeu de données par commune, issu de l'inventaire détaillé élaboré par M. Illaire aux Archives nationales, constitue une masse d'informations conséquente sur le paysage économique et énergétique français à l'aube du 19e siècle. Les informations de l'inventaire ont été alignées autant que possible avec les communes actuelles afin de permettre une géolocalisation pour la majeure partie des communes. Le jeu de données mis à disposition est constitué des informations suivantes :
  * Pays ;
  * Commune actuelle (lorsque les données initiales le permettent) ;
  * Département actuel ;
  * Date de l'enquête ;
  * Type de moulin (principalement à eau ou à vent) ;
  * Nombre de moulins ;  
  * Nom du moulin ;
  * Département ancien (19e siècle) ;
  * Commune ancienne (19e siècle) ;  
  * Description initiale (dans l'inventaire de 1998, avant rétroconversion des données) ;
  * URL de la notice sur le portail des Archives nationales ;
  * Cote du dossier ;  
  * Code INSEE (pour la France, d'après la commune actuelle).  
La géolocalisation proposée ici est faite à partir des communes françaises et leur code INSEE ; les 562 lieux situés aujourd'hui en dehors des frontières françaises ne contiennent donc pas de données de géolocalisation.

Ce jeu de données est une des sources de datavisualisations disponibles sur le site [Data pathologies](https://data.ameli.fr/pages/data-pathologies/).
### Informations générales :
Les données présentent des informations sur les dépenses remboursées par l'ensemble des régimes d'assurance maladie et affectées à chaque pathologie, traitement chronique ou épisode de soins. Ces dépenses sont réparties entre :
  * les soins de ville (dont soins de médecins, soins infirmiers ou de kinésithérapie, médicament, biologie, transports, etc.) ;
  * les hospitalisations dans des établissements de santé publics ou privés ;
  * les prestations en espèces (dont indemnités journalières).
Les pathologies, traitements chroniques et épisodes de soins sont regroupés dans les catégories suivantes :
  * maladies cardioneurovasculaires ;
  * traitements du risque vasculaire (hors pathologies) ;
  * diabète ;
  * cancers ;
  * pathologies psychiatriques ;
  * traitements psychotropes (hors pathologies) ;
  * maladies neurologiques ;
  * maladies respiratoires chroniques (hors mucoviscidose) ;
  * maladies inflammatoires ou rares ou infection VIH ;
  * insuffisance rénale chronique terminale ;
  * maladies du foie ou du pancréas (hors mucoviscidose) ;
  * affections de longue durée (dont 31 et 32) pour d'autres causes ;
  * hospitalisation pour Covid-19 (à partir de 2020) ;
  * maternité (avec ou sans pathologies) ;
  * traitement antalgique ou anti-inflammatoire (hors pathologies, traitements, maternité ou hospitalisations) ;
  * hospitalisations hors pathologies repérées (avec ou sans pathologies, traitements ou maternité).
Les dépenses remboursées des personnes qui ne présentent aucune des pathologies, traitements chroniques ou épisodes de soins mentionnés ci-dessus sont également présentées, ainsi que celles attribuées à la consommation courante de soins pour l’ensemble de la population de la cartographie des pathologies et des dépenses de l'Assurance Maladie.
Les dépenses proposées sont de différents types :
  * dépenses totales annuelles remboursées (par an) ;
  * dépenses moyennes annuelles remboursées (par an et par patient).
Les effectifs de patients sont également présentés dans les données. La population de référence est celle de la cartographie des pathologies et des dépenses de l'Assurance Maladie.
### Qu’est-ce que la population de la cartographie des pathologies et des dépenses de l’Assurance Maladie ?
La population de la cartographie recense l’ensemble des bénéficiaires de l’assurance maladie obligatoire, quel que soit leur régime d’affiliation :
  * ayant bénéficié d'au moins une prestation dans l’année (soins de médecins, soins infirmiers ou de kinésithérapie, médicament, biologie, transports etc.) ;
  * et/ou ayant séjourné au moins une fois dans un établissement de santé public ou privé dans l’année (séjours en médecine, chirurgie, obstétrique, psychiatrie, soins de suite et de réadaptation, actes et consultations externes ou hospitalisation à domicile).
Elle rassemble en 2024, 67,4 millions de bénéficiaires de l'ensemble des régimes d'assurance maladie, ayant eu recours à des soins remboursés. Cette population est utilisée par la Caisse nationale de l’assurance Maladie (Cnam) pour réaliser de nombreuses études et produire des données sur les pathologies et les dépenses de l’Assurance Maladie.
Pour plus d'informations, consulter la page [Méthode](https://observatoirepathologies-cnam.opendatasoft.com/pages/methode/) du site.
### Secret statistique :
Par respect pour le secret statistique (loi du 7 juin 1951) et afin que l’identification directe ou indirecte des individus soit impossible, aucune information sur les effectifs n'est communiquée lorsque le nombre de patients pris en charge est inférieur à 11. La valeur de l'indicateur est alors indiqué par la variable « NS » (non significatif) dans le jeu de données et fixée à "Non significatif" dans les représentations graphiques.
### Mise à jour du 11/07/2025 : actualisation des données de 2015 à 2023
L’historique des données a été mis à jour :
  * les données de **2015 à 2022 ont été actualisées**
  * les données de **2023 sont maintenant disponibles**
Cette nouvelle version des données (juillet 2025) remplace ainsi la précédente (datant de juillet 2024).
### Mise à jour des données :
Les données proposées en téléchargement dans l’onglet « Export » sont mises à jour chaque année (données de la France entière de 2015 à 2023).
### Source :
Les données sont issues du système national des données de santé (SNDS).   
### Autres informations :

Ce jeu de données est une des sources de datavisualisations disponibles sur le site [Data pathologies](https://data.ameli.fr/pages/data-pathologies/).
### Informations générales :
Les données présentent des informations sur les comorbidités associées aux pathologies (ou traitements chroniques ou épisodes de soins) repérées par la Caisse nationale de l’Assurance Maladie (Cnam) : parmi les patients pris en charge pour une pathologie donnée (ou traitement chronique ou épisode de soins), certains peuvent également être pris en charge pour une ou plusieurs autres pathologies, appelées comorbidités.
**À noter** : il n’est pas possible de sommer les fréquences ou les effectifs des comorbidités, un même patient pouvant être pris en charge pour plusieurs comorbidités.
Les pathologies, traitements chroniques et épisodes de soins sont regroupés dans les catégories suivantes :
  * maladies cardioneurovasculaires ;
  * traitements du risque vasculaire (hors pathologies) ;
  * diabète ;
  * cancers ;
  * pathologies psychiatriques ;
  * traitements psychotropes (hors pathologies) ;
  * maladies neurologiques ;
  * maladies respiratoires chroniques (hors mucoviscidose) ;
